def throughput(exits, path, route, widths=[]):
	entrance = route[-1]
	if entrance in exits:
		return min(widths)
	total = []
	for index, room in enumerate(path[entrance]):
		if room != 0 and index not in route:
			# print('  '*(len(route)-1), '-', route + [index], widths + [room])
			total.append(throughput(exits, path, route + [index], widths + [room]))
	# print('  '*(len(route)-1), '-', total, len(route))
	if len(route) > 1:
		return max(total)
	else:
		return sum(total)

def get_bunnies(entrances, exits, path):
	bunnies = [0]*len(path)
	for entrance in entrances:
		bunnies[entrance] = sum(path[entrance])
	rooms = entrances[:]
	visited = []
	while rooms not in [exits, []]:
		new_rooms = []
		for room in rooms:
			sorted_room = []
			for next_room, corridor_space in enumerate(path[room]):
				if corridor_space != 0 and next_room not in (visited + rooms):
					sorted_room.append((next_room, corridor_space))
			for next_room, corridor_space in sorted_room:
				if bunnies[room] < corridor_space:
					bunnies[next_room] += bunnies[room]
					bunnies[room] = 0
				else:
					bunnies[next_room] += corridor_space
					bunnies[room] -= corridor_space
				if next_room not in (new_rooms + exits):
					new_rooms.append(next_room)
				if room not in (visited + exits):
					visited.append(room)
		rooms = new_rooms
	return sum(bunnies[exit] for exit in exits)